import React, { useEffect } from 'react';

const CanvasComponent = () => {
    useEffect(() => {
        // Code à exécuter lors du montage du composant
        const canvas = document.getElementById("canvas");
        const ctx = canvas.getContext("2d");
        let w = (ctx.canvas.width = window.innerWidth);
        let h = (ctx.canvas.height = window.innerHeight);
        let points = [];
        let dots = [];
        const lines = 7;
        let nt = 0;
        let hueBase = 330;
        let satBase = 60;

        // Fonction pour ajouter des points initiaux
        const pushPoints = () => {
            for (let i = 0; i < lines; i++) {
                points.push({
                    xs: -5,
                    ys: (h / lines) * i,
                    xp1: Math.random() * (w / 3),
                    yp1: (h / lines) * i + Math.random() * 200 - 100 + 100,
                    xp2: Math.random() * (w / 3) + (w / 3) * 2,
                    yp2: (h / lines) * i + Math.random() * 300 - 200 + 100,
                    xe: w + 5,
                    ye: (h / lines) * i,
                });
            }
        };

        // Fonction pour ajouter des points mobiles
        const pushDots = () => {
            if (dots.length > 200) {
                return;
            }
            const rad = Math.random() * (4 - 1) + 1;
            const zix = Math.floor(Math.random() * lines + 1);
            dots.push({
                x: Math.random() * w,
                y: h + 30,
                v: 4 - rad / 1.2,
                r: (rad + zix) * 0.5,
                h: Math.random() * 20,
                z: zix,
            });
        };

        // Fonction pour dessiner les éléments
        const draw = () => {
            nt += 0.003;
            for (let i = 0; i < points.length; i++) {
                for (let j = 0; j < dots.length; j++) {
                    if (dots[j].z === i) {
                        ctx.beginPath();
                        ctx.fillStyle = `hsl(${hueBase + dots[j].h}, ${satBase}%, ${
                            80 - i * (60 / lines)
                        }%)`;
                        ctx.arc(dots[j].x, dots[j].y, dots[j].r, 0, Math.PI * 2);
                        ctx.fill();
                        ctx.closePath();

                        if (dots[j].y < 0 || dots[j].y > h + 60) {
                            dots[j] = dots[dots.length - 1];
                            dots.pop();
                        } else {
                            dots[j].y -= dots[j].v;
                        }
                    }
                }

                const nyp1 =
                    noise.perlin2(points[i].yp1 / 100, nt) * ((lines * 70) - (i * 100)) +
                    10;
                const nyp2 =
                    noise.perlin2(points[i].yp2 / 100, nt) * ((lines * 70) - (i * 100)) +
                    10;
                ctx.beginPath();
                ctx.fillStyle = `hsl(${hueBase + i * (50 / lines)}, ${satBase}%, ${
                    20 + i * (60 / lines)
                }%)`;
                ctx.moveTo(points[i].xs, points[i].ys);
                ctx.bezierCurveTo(
                    points[i].xp1,
                    points[i].yp1 + nyp1,
                    points[i].xp2,
                    points[i].yp2 + nyp2,
                    points[i].xe,
                    points[i].ye
                );
                ctx.lineTo(w + 5, h + 5);
                ctx.lineTo(-5, h + 5);
                ctx.lineTo(-5, h + 5);
                ctx.fill();
                ctx.closePath();
            }
        };

        // Fonction pour effacer le canvas
        const clear = () => {
            ctx.clearRect(0, 0, w, h);
        };

        // Fonction pour effacer les points mobiles
        const clearDots = () => {
            dots = [];
        };

        // Fonction pour rendre le canvas
        const render = () => {
            clear();
            draw();
            requestAnimationFrame(render);
        };

        pushPoints();
        setInterval(pushDots, 50);
        setInterval(clearDots, 90000);
        render();

        let mouseDown = false;
        const handleMouseDown = () => {
            mouseDown = true;
        };
        const handleMouseUp = () => {
            mouseDown = false;
        };
        const handleMouseMove = (e) => {
            if (!mouseDown) {
                return;
            }
            hueBase = (e.clientX / w) * 360;
            satBase = (e.clientY / h) * 100;
        };

        window.addEventListener('mousedown', handleMouseDown);
        window.addEventListener('mouseup', handleMouseUp);
        window.addEventListener('mousemove', handleMouseMove);

        return () => {
            // Nettoyage des événements lors du démontage du composant
            window.removeEventListener('mousedown', handleMouseDown);
            window.removeEventListener('mouseup', handleMouseUp);
            window.removeEventListener('mousemove', handleMouseMove);
        };
    }, []);

    return (
        <div>
            <canvas id="canvas"></canvas>
            <div id="info">Click & Drag for new Colors</div>
        </div>
    );
};

export default CanvasComponent;
